import './Hero.css';

const Hero = () => {
  return (
    <section className="hero">
      <h1>Welcome to MeetYourNeed (WorkNest)</h1>
      <p>A secure freelancing platform connecting clients and vendors across writing, design, web development & more.</p>
      <button className="hero-btn">Get Started</button>
    </section>
  );
};

export default Hero;
